INSERT INTO PUBLIC.ACERO(ID, NOMBRE, LIMITE_ELASTICO, NOTA) VALUES(1, 'B400S', 400, STRINGDECODE('La normalizaci\u00f3n de t\u00e9cnica de las barras corrugadas \nest\u00e1 cubierta por la Instrucci\u00f3n de Hormig\u00f3n estructural \n(EHE) y por la Norma UNE 36068:96 ``Barras corrugadas \nde acero soldable para armaduras de hormig\u00f3n armado``, \nque contempla para  usos habituales dos tipos de acero \npara barras: B400S y B500S, ambos soldables.\n\nTodas las corrugas tienen la misma inclinaci\u00f3n, pero\npresentan separaciones diferentes en cada uno de los\nsectores de la barra.'));
INSERT INTO PUBLIC.ACERO(ID, NOMBRE, LIMITE_ELASTICO, NOTA) VALUES(2, 'B500S', 500, STRINGDECODE('La normalizaci\u00f3n de t\u00e9cnica de las barras corrugadas \nest\u00e1 cubierta por la Instrucci\u00f3n de Hormig\u00f3n estructural \n(EHE) y por la Norma UNE 36068:96 ``Barras corrugadas \nde acero soldable para armaduras de hormig\u00f3n armado``, \nque contempla para  usos habituales dos tipos de acero \npara barras: B400S y B500S, ambos soldables.\n\nLas corrugas de uno de los sectores tienen la misma\n inclinaci\u00f3n y est\u00e1n uniformemente separadas. Las del otr\no sector est\u00e1n agrupadas en dos series de la misma\n separaci\u00f3n pero distinta inclinaci\u00f3n.'));
INSERT INTO PUBLIC.ACERO(ID, NOMBRE, LIMITE_ELASTICO, NOTA) VALUES(3, 'B400SD', 400, STRINGDECODE(' Las barras de acero B400SD y B500SD est\u00e1n cubiertas por\nla Norma UNE 36065:00, ``Barras corrugadas de acero\nsoldable con caracter\u00edsticas especiales de ductilidad para\narmaduras de hormig\u00f3n armado``. Este tipo de acero est\u00e1\nindicado en todas aquellas situaciones en las que se\nrequieren unas prestaciones especiales de ductilidad.\n\nTodas las corrugas tienen la misma separaci\u00f3n y la misma\ninclinaci\u00f3n.'));
INSERT INTO PUBLIC.ACERO(ID, NOMBRE, LIMITE_ELASTICO, NOTA) VALUES(4, 'B500SD', 500, STRINGDECODE(' Las barras de acero B400SD y B500SD est\u00e1n cubiertas por\nla Norma UNE 36065:00, ``Barras corrugadas de acero\nsoldable con caracter\u00edsticas especiales de ductilidad para\narmaduras de hormig\u00f3n armado``. Este tipo de acero est\u00e1\nindicado en todas aquellas situaciones en las que se\nrequieren unas prestaciones especiales de ductilidad.\n\nLas corrugas en los dos sectores est\u00e1n agrupadas en dos\nseries de la misma separaci\u00f3n pero distinta inclinaci\u00f3n.'));
